export const ProfileIcon = () => {
  return (
    <svg className="Icon Icon--account" role="presentation" viewBox="0 0 20 20">
      <g
        transform="translate(1 1)"
        stroke="currentColor"
        strokeWidth="2"
        fill="none"
        fillRule="evenodd"
        strokeLinecap="square"
      >
        <path d="M0 18c0-4.5188182 3.663-8.18181818 8.18181818-8.18181818h1.63636364C14.337 9.81818182 18 13.4811818 18 18"></path>
        <circle cx="9" cy="4.90909091" r="4.90909091"></circle>
      </g>
    </svg>
  );
};

export const SearchIconMobile = () => {
  return (
    <svg className="Icon Icon--search" role="presentation" viewBox="0 0 18 17">
      <g
        transform="translate(1 1)"
        stroke="currentColor"
        fill="none"
        fillRule="evenodd"
        strokeLinecap="square"
      >
        <path d="M16 16l-5.0752-5.0752"></path>
        <circle cx="6.4" cy="6.4" r="6.4"></circle>
      </g>
    </svg>
  );
};

export const SearchDeskptop = () => {
  return (
    <svg
      className="Icon Icon--search-desktop"
      role="presentation"
      viewBox="0 0 21 21"
    >
      <g
        transform="translate(1 1)"
        stroke="currentColor"
        strokeWidth="2"
        fill="none"
        fillRule="evenodd"
        strokeLinecap="square"
      >
        <path d="M18 18l-5.7096-5.7096"></path>
        <circle cx="7.2" cy="7.2" r="7.2"></circle>
      </g>
    </svg>
  );
};

export const WishListMobile = () => {
  return (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      className="Icon Icon--search-desktop"
      // width="20"
      // height="20"
      viewBox="0 0 20 16"
    >
      <path
        d="M8.695 16.682C4.06 12.382 1 9.536 1 6.065 1 3.219 3.178 1 5.95 1c1.566 0 3.069.746 4.05 1.915C10.981 1.745 12.484 1 14.05 1 16.822 1 19 3.22 19 6.065c0 3.471-3.06 6.316-7.695 10.617L10 17.897l-1.305-1.215z"
        stroke="currentColor"
        fill="none"
        strokeWidth="1.3"
        fillRule="evenodd"
      ></path>{" "}
    </svg>
  );
};

export const WishListDesktop = () => {
  return (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      className="Icon Icon--search-desktop"
      // width="20"
      // height="20"
      viewBox="0 0 20 16"
    >
      <path
        d="M8.695 16.682C4.06 12.382 1 9.536 1 6.065 1 3.219 3.178 1 5.95 1c1.566 0 3.069.746 4.05 1.915C10.981 1.745 12.484 1 14.05 1 16.822 1 19 3.22 19 6.065c0 3.471-3.06 6.316-7.695 10.617L10 17.897l-1.305-1.215z"
        stroke="currentColor"
        strokeWidth="2"
        fill="none"
        fillRule="evenodd"
      ></path>
    </svg>
  );
};

export const CartMobile = () => {
  return (
    <svg className="Icon Icon--cart" role="presentation" viewBox="0 0 17 20">
      <path
        d="M0 20V4.995l1 .006v.015l4-.002V4c0-2.484 1.274-4 3.5-4C10.518 0 12 1.48 12 4v1.012l5-.003v.985H1V19h15V6.005h1V20H0zM11 4.49C11 2.267 10.507 1 8.5 1 6.5 1 6 2.27 6 4.49V5l5-.002V4.49z"
        fill="currentColor"
      ></path>
    </svg>
  );
};

export const CartDesktop = () => {
  return (
    <svg
      className="Icon Icon--cart-desktop"
      role="presentation"
      viewBox="0 0 19 23"
    >
      <path
        d="M0 22.985V5.995L2 6v.03l17-.014v16.968H0zm17-15H2v13h15v-13zm-5-2.882c0-2.04-.493-3.203-2.5-3.203-2 0-2.5 1.164-2.5 3.203v.912H5V4.647C5 1.19 7.274 0 9.5 0 11.517 0 14 1.354 14 4.647v1.368h-2v-.912z"
        fill="currentColor"
      ></path>
    </svg>
  );
};

export const MenuDesktop = () => {
  return (
    <svg className="Icon Icon--nav" role="presentation" viewBox="0 0 20 14">
      <path
        d="M0 14v-1h20v1H0zm0-7.5h20v1H0v-1zM0 0h20v1H0V0z"
        fill="currentColor"
      ></path>
    </svg>
  );
};

export const MenuMobile = () => {
  return (
    <svg
      className="Icon Icon--nav-desktop"
      role="presentation"
      viewBox="0 0 24 16"
    >
      <path
        d="M0 15.985v-2h24v2H0zm0-9h24v2H0v-2zm0-7h24v2H0v-2z"
        fill="currentColor"
      ></path>
    </svg>
  );
};
